// BlinkingStars.js

import React from 'react';
import './BlinkingStars.css';

const Shorts = () => {
  return (
    <div className="night-sky">
      <div className="star"></div>
      <div className="star"></div>
      <div className="star"></div>
    </div>
  );
};

export default BlinkingStars;
